function Header(props) {
    return (
        <div class="navbar">
            <div class="container flex">
                <h1 class="logo">{props.title}</h1>
                <nav>
                    <ul>
                        {/* <li><a><Link to="/">Home</Link></a></li> */}
                        <li><a href="features.html">Replays</a></li>
                        <li><a href="docs.html">Login</a></li>
                    </ul>
                </nav>
            </div>
        </div>
    )
  }


  export default Header
